import React from "react";
import { Typography } from "@material-ui/core";

const ProvinceStats = () => {
    return (
        <div>
            <Typography component="h2" variant="h5">
                Kasus Berdasarkan Provinsi
            </Typography>
        </div>
    );
};

export default ProvinceStats;
